drop table if exists usr_address;
create table usr_address (
	carVin VARCHAR(50),
	city VARCHAR(50),
	country VARCHAR(50),
	country_cd VARCHAR(50),
	lat VARCHAR(50),
	lng VARCHAR(50),
	phone VARCHAR(50),
	postal_code VARCHAR(50),
	state VARCHAR(50),
	state_cd VARCHAR(50),
	street_add VARCHAR(50),
	street_name VARCHAR(50),
	street_num VARCHAR(50),
	street_suf VARCHAR(50),
	timeZone VARCHAR(50),
	ct_date VARCHAR(50),
	time VARCHAR(50),
	usr_name VARCHAR(50)
);
